import React from 'react';

import classes from './Header.module.css';

import mealsImage from "https://github.com/academind/react-complete-guide-code/blob/11-practice-food-order-app/extra-files/meals.jpg?raw=true";

const Header = (props) => {
    return (
      <>
        <header>
          <h1>ReactMeals</h1>
          <button>Cart</button>
        </header>
        <div>
          <img src={mealsImage} />
        </div>
      </>
    );
}

export default Header;
